import { useState } from 'react';
import './App.css';
import data from "./components/data/data"
import TWeetForm from './components/TweetForm.jsx'
// import Tweet from "./components/Tweet"
// import TweetList from "./components/TweetList"
// import { useState } from 'react';

function App() {
  let tweets=data.map((a)=>(
      <TWeetForm username={a.fullname} tag={a.tagname} description={a.description} img={a.desc_img} comments={a.comments} retweets={a.retweets} likes={a.likes} stats={a.stats} user_img={a.user_img} />
  ))
  return (

    <div className="container">

            {tweets}

             {/* <TweetList />
    //         <Tweet /> */}
    </div>
  )
};

export default App;
